INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (2, 800369, N'Thor', N'Thor', 2011, N'Against his father Odin''s will, The Mighty Thor (Hemsworth)--a powerful but arrogant warrior-god--recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.', N'http://cf2.imgobject.com/t/p/w185/bIuOWTtyFPjsFDevqvF3QrD1aun.jpg', 2, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (3, 120695, N'Um Drink no Inferno 3: A Filha do Enforcado', N'From Dusk Till Dawn 3: The Hangman''s Daughter', 1999, N'Set 100 years ago in Mexico, this horror/western is the story of the birth of the vampire princess Santanico Pandemonium.', N'http://cf2.imgobject.com/t/p/w185/8vFOXcLzG3SOdyZQsBg6NMmIGXV.jpg', 3, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (4, 93773, N'Predador', N'Predator', 1987, N'Dutch and his group of commandos are hired by the CIA to rescue downed airmen from guerillas in a Central American jungle. The mission goes well but as they return they find that something is hunting them. Nearly invisible, it blends in with the forest, taking trophies from the bodies of it''s victims as it goes along. Occasionally seeing through it''s eyes, the audience sees it is an intelligent alien hunter, hunting them for sport, killing them off one at a time.', N'http://cf2.imgobject.com/t/p/w185/gUpto7r2XwoM5eW7MUvd8hl1etB.jpg', 4, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (5, 411477, N'Hellboy II: O Exército Dourado', N'Hellboy II: The Golden Army', 2008, N'In this continuation to the adventure of the demon superhero, an evil elf breaks an ancient pact between humans and creatures, as he declares war against humanity. He is on a mission to release The Golden Army, a deadly group of fighting machines that can destroy the human race. As Hell on Earth is ready to erupt, Hellboy and his crew set out to defeat the evil prince.', N'http://cf2.imgobject.com/t/p/w185/p8d03gmcs3gCGZ1TkZMfmnKetA.jpg', 5, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (6, 245844, N'O Conde de Monte Cristo', N'The Count of Monte Cristo', 2002, N'Edmond Dantés''s life and plans to marry the beautiful Mercedes are shattered when his best friend, Fernand, deceives him. After spending 13 miserable years in prison, Dantés escapes with the help of a fellow inmate and plots his revenge, cleverly insinuating himself into the French nobility.', N'http://cf2.imgobject.com/t/p/w185/u1tLUDAMjOutrnSCyDhiiyZs50L.jpg', 6, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (7, 94226, N'Os Intocáveis', N'The Untouchables', 1987, N'Young Treasury Agent Elliot Ness arrives in Chicago and is deternimed to take down Al Capone but it''s not going to be easy, because Capone has the police in his pocket. Ness meets Jimmy Malone a veteran patrolman and probably the most honorable one in the force. He asks Malone to help him get Capone but Malone warns him that if he goes after Capone, he is going to war.', N'http://cf2.imgobject.com/t/p/w185/nv7FOs90Y3Cq5tBhEITEV8Zebyw.jpg', 7, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (8, 120737, N'O Senhor dos Anéis: A Sociedade do Anel', N'The Lord of the Rings: The Fellowship of the Ring', 2001, N'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', N'http://cf2.imgobject.com/t/p/w185/9HG6pINW1KoFTAKY3LdybkoOKAm.jpg', 8, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (9, 120860, N'Um Drink no Inferno 2: Texas Sangrento', N'From Dusk Till Dawn 2: Texas Blood Money', 1999, N'A gang of bank-robbing misfits heads to Mexico with the blueprints for the perfect million-dollar heist, but when one of the crooks wanders into the wrong bar... and crosses the wrong vampire... the thieving cohorts develop a thirst for blood!', N'http://cf2.imgobject.com/t/p/w185/gcRpblYhnw9UKJWcXyL7MGJEwhq.jpg', 9, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (10, 167261, N'O Senhor dos Anéis: As Duas Torres', N'The Lord of the Rings: The Two Towers', 2002, N'Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.', N'http://cf2.imgobject.com/t/p/w185/9mBjBuUmBBgnGjV1JZ2uCIYbaph.jpg', 8, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (11, 167260, N'O Senhor dos Anéis: O Retorno do Rei', N'The Lord of the Rings: The Return of the King', 2003, N'Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron''s forces. Meanwhile, Frodo and Sam bring the ring closer to the heart of Mordor, the dark lord''s realm.', N'http://cf2.imgobject.com/t/p/w185/j6NCjU6Zh7SkfIeN5zDaoTmBn4m.jpg', 8, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (12, 144964, N'Highlander: A Batalha Final', N'Highlander: Endgame', 2000, N'Immortals Connor and Duncan Macleod must join forces against Kell, an evil immortal who has become too strong for anyone to face alone.', N'http://cf2.imgobject.com/t/p/w185/zWWnmSLWXIpDXeZ1Y3ZNZOnmxe9.jpg', 10, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (13, 834001, N'Anjos da Noite: A Origem dos Lycans', N'Underworld: Rise of the Lycans', 2009, N'A prequel to the first two Underworld films, this fantasy explains the origins of the feud between the Vampires and the Lycans. Aided by his secret love, Sonja, courageous Lucian leads the Lycans in battle against brutal Vampire king Viktor. Determined to break the king''s enslavement of his people, Lucian faces off against the Death Dealer army in a bid for Lycan independence.', N'http://cf2.imgobject.com/t/p/w185/exnsDyB7089JHJ3w6tnWtgkguLR.jpg', 11, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (14, 181739, N'Osmose Jones', N'Osmosis Jones', 2001, N'A policeman white blood cell, with the help of a cold pill, must stop a deadly virus from destroying the human they live in, Frank.', N'http://cf2.imgobject.com/t/p/w185/laNwAki8c6Jc3DRKR31q9arpgUn.jpg', 12, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (15, 416449, N'300', N'300', 2006, N'Based on Frank Miller''s graphic novel, "300" concerns the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world''s first democracy.', N'http://cf2.imgobject.com/t/p/w185/z6hyEVenS957hIbaxIM4tQ6kGsT.jpg', 13, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (16, 465657, N'Highlander: A Busca por Vingança', N'Highlander: The Search for Vengeance', 2007, N'Colin MacLeod hunts for the man responsible for the death of his love. He chases the immortal Marcus Octavius across centuries as his quest threatens to take over his life and heart. In his quest, he meets a woman who reminds him of his slain beauty. But it''s his final battle with Marcus that will decide not only his fate, but also the fate of everyone in the world.', N'http://cf2.imgobject.com/t/p/w185/2L1jFW1S3JRgBYTCXnuU6dQE77j.jpg', 14, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (17, 1205489, N'Gran Torino', N'Gran Torino', 2008, N'Walt Kowalski, an iron-willed and inflexible Korean War veteran living in a changing world, is forced by his immigrant neighbors to confront his long-held prejudices.', N'http://cf2.imgobject.com/t/p/w185/lM1EaWdIdwfSxG50HinOLGmXLih.jpg', 15, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (18, 299981, N'Highlander: A Origem', N'Highlander: The Source', 2007, N'The world is falling into chaos. As he roams a crumbling city, Duncan MacLeod, the Highlander, remembers happier times before the love of his life left... Hopeless and alone, MacLeod finds his way to a band of immortal companions, including his mysterious friend Methos, and a mortal, Watcher Joe Dawson. Together this small group sets out on a quest to find the origin of the first Immortal.', N'http://cf2.imgobject.com/t/p/w185/8IqMfjtUFbVmmtqZwLSBGHfSPD7.jpg', 16, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (19, 1174954, N'Resident Evil: Degeneração', N'Resident Evil: Degeneration', 2008, N'A zombie attack brings chaos to Harvardville Airport. Leon Kennedy and Claire Redfield , who fought the sinister Umbrella Corporation during the Raccoon City tragedy 7 years ago, are back. In high-octane Resident Evil style, they''re ready to battle a rogue warrior who is seeking revenge after his family was killed in Raccoon City. The deadly G-Virus is unleashed and a new mutated monster rampages.', N'http://cf2.imgobject.com/t/p/w185/4IEnoozWcUkmRmGgdqaCEhty6ji.jpg', 17, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (20, 83944, N'Rambo - Programado para Matar', N'First Blood', 1982, N'When former Green Beret John Rambo is harassed by local law enforcement and arrested for vagrancy, the Vietnam vet snaps, runs for the hills and rat-a-tat-tats his way into the action-movie hall of fame. Hounded by a relentless sheriff, Rambo employs heavy-handed guerilla tactics to shake the cops off his tail.', N'http://cf2.imgobject.com/t/p/w185/wOsPbJixVc80iilfcByLKPAKz6G.jpg', 18, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (21, 89880, N'Rambo II - A Missão', N'Rambo: First Blood Part II', 1985, N'Col. Troutman recruits ex-Green Beret John Rambo for a highly secret and dangerous mission. Teamed with freedom fighter Co Bao, Rambo goes deep into Vietnam to rescue POWs. Deserted by his own team, he''s left in a hostile jungle to fight for his life, avenge the death of a woman and bring corrupt officials to justice.', N'http://cf2.imgobject.com/t/p/w185/xYLmHi80zIlu3JDfJYfd1JY0Xl7.jpg', 19, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (22, 95956, N'Rambo III', N'Rambo III', 1988, N'Combat has taken its toll on Rambo, but he''s finally begun to find inner peace in a monastery. When Rambo''s friend and mentor Col. Trautman asks for his help on a top secret mission to Afghanistan, Rambo declines but must reconsider when Trautman is captured.', N'http://cf2.imgobject.com/t/p/w185/s54DchYWkSTCi9z7Is2IIX3qmvw.jpg', 20, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (23, 167190, N'Hellboy', N'Hellboy', 2004, N'In the final days of World War II, the Nazis attempt to use black magic to aid their dying cause. The Allies raid the camp where the ceremony is taking place, but not before a demon - Hellboy - has already been conjured. Joining the Allied forces, Hellboy eventually grows to adulthood, serving the cause of good rather than evil.', N'http://cf2.imgobject.com/t/p/w185/UqfpYs9ii90UblvCx7yzOh1syq.jpg', 5, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (24, 120804, N'Resident Evil', N'Resident Evil', 2002, N'When a virus leaks from a top-secret facility, turning all resident researchers into ravenous zombies and their lab animals into mutated hounds from hell, the government sends in an elite military task force to contain the outbreak. Alice and Rain are charged with leading the mission. But they only have three hours before the pathogen becomes airborne and infects the world.', N'http://cf2.imgobject.com/t/p/w185/wIzLKDzqdxlsQWVtHnyiuC2rD98.jpg', 21, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (25, 318627, N'Resident Evil: Apocalipse', N'Resident Evil: Apocalypse', 2004, N'Something evil''s lurking in Raccoon City, and the fearless Alice is one of only a few willing to put her life on the line to investigate the malevolent force. A virus is attacking the area''s denizens, turning them into the undead. With the help of her colleague, Jill, Alice sets out to uncover the truth, even as she fends off an experimental weapon, code name Nemesis.', N'http://cf2.imgobject.com/t/p/w185/lZFpJ8r6ODmeheq4KxV4X0T47I5.jpg', 22, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (26, 100403, N'Predador 2', N'Predator 2', 1990, N'Ten years after a band of mercenaries first battled a vicious alien, the invisible creature from another world has returned to Earth -- and this time, it''s drawn to the gang-ruled and ravaged city of Los Angeles. When it starts murdering drug dealers, detective-lieutenant Mike Harrigan and his police force set out to capture the creature, ignoring warnings from a mysterious government agent to stay away.', N'http://cf2.imgobject.com/t/p/w185/uewGs5MABWjUcy6yVZZkttqv6WK.jpg', 23, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (27, 371746, N'Homem de Ferro', N'Iron Man', 2008, N'Tony Stark (Robert Downey Jr.) is a wealthy playboy and talented weapons manufacturer. When he discovers a deadly conspiracy that could destabilize the entire globe, he develops a powerful robotic suit to fight the villians and save the world.', N'http://cf2.imgobject.com/t/p/w185/s2IG9qXfhJYxIttKyroYFBsHwzQ.jpg', 1, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (28, 458339, N'Capitão América: O Primeiro Vingador', N'Captain America: The First Avenger', 2011, N'A brave, yet mild-mannered young soldier named Steve Rogers, volunteers to undergo a series of experiments for a US army Super Soldier program. The military succeeds in transforming him into a human weapon, but quickly decide that their Super Soldier is far too expensive a creation to risk in combat. So, they decide to put him to use as an army celebrity and parade him across Europe to boost morale by performing in USO shows for American troops. He is even given a costume that bear the colors of Old Glory for the stage. Then, when a Nazi plot reveals itself Rogers must rise up and and become the First Avenger, in order to save his country.', N'http://cf2.imgobject.com/t/p/w185/sBZs1jSybBRBXDwcCR8IOyHLUMc.jpg', 24, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (29, 93692, N'Falcão - O Campeão dos Campeões', N'Over the Top', 1987, N'Sylvester Stallone stars as hard-luck big-rig trucker Lincoln Hawk and takes us under the glaring Las Vegas lights for all the boisterous action of the World Armwrestling Championship. Relying on wits and willpower, Hawk tries to rebuild his life by capturing the first-place prize money - and the love of the son he abandoned years earlier into the keeping of his his rich, ruthless father-in-law.', N'http://cf2.imgobject.com/t/p/w185/rnAxGFrFaHemdjjFDQDtjOzV8z5.jpg', 25, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (30, 401792, N'Sin City - A Cidade do Pecado', N'Sin City', 2005, N'Sin City is a neo-noir crime thriller based on Frank Miller''s graphic novel series of the same name.The film is primarily based on three of Miller''s works: The Hard Goodbye, about a man who embarks on a brutal rampage in search of his one-time sweetheart''s killer; The Big Fat Kill, which focuses on a street war between a group of prostitutes and a group of mercenaries; and That Yellow Bastard, which follows an aging police officer who protects a young woman from a grotesquely disfigured serial killer.', N'http://cf2.imgobject.com/t/p/w185/eCJkepVJslq1nEtqURLaC1zLPAL.jpg', 26, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (31, 120657, N'O 13º Gerreiro', N'The 13th Warrior', 1999, N'In AD 922, Arab courtier Ahmad Ibn Fadlan (Antonio Banderas) accompanies a party of Vikings to the barbaric North to combat a terror that slaughters Vikings and devours their flesh.', N'http://cf2.imgobject.com/t/p/w185/ooR8S0O0ZgxK2OBnT1GWHrr9w92.jpg', 4, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (32, 1156398, N'Zumbilândia', N'Zombieland', 2009, N'An easily spooked guy, Columbus, joins forces with wild man Tallahassee to fight for survival in a world virtually taken over by freakish zombies. As they destroy scores of the undead, they meet up with two other survivors, Little Rock and Wichita, and journey to a supposedly safe abandoned amusement park.', N'http://cf2.imgobject.com/t/p/w185/5l0DJGdrCfButyXtz7zHutT4Xru.jpg', 27, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (33, 499549, N'Avatar', N'Avatar', 2009, N'Avatar is set in the mid-22nd century, at a time when humans have depleted Earth''s resources, and are mining lucrative unobtanium on Pandora, a lush moon in the Alpha Centauri star system. When his twin brother dies, disabled Marine Jake Sully travels to Pandora in his place to become an Avatar, an alien-human hybrid body electronically linked to a genetically matched human, to integrate himself with the native Na''vi and help the mining effort. But he finds himself caught in between an interstellar conflict after falling for Na''vi warrior Neytiri.', N'http://cf2.imgobject.com/t/p/w185/8Ic8rRVoVrDJJlXzVzGxAesufUV.jpg', 28, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (34, 382932, N'Ratatouille', N'Ratatouille', 2007, N'In one of Paris'' finest restaurants, Remy, a determined young rat, dreams of becoming a renowned French chef. Torn between his family''s wishes and his true calling. Remy and his pal Linguini set in motion a hilarious chain of events that turns the City of Lights upside down.', N'http://cf2.imgobject.com/t/p/w185/furtJN0JDzWO9dLVZ5HrdcHms7O.jpg', 29, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (35, 458525, N'X-Men Origens: Wolverine', N'X-Men Origins: Wolverine', 2009, N'After seeking to live a normal life, Logan sets out to avenge the death of his girlfriend by undergoing the mutant Weapon X program and becoming Wolverine.', N'http://cf2.imgobject.com/t/p/w185/vbaV7DalSF6Uy4qLyVK7uNdtmFy.jpg', 30, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (36, 367882, N'Indiana Jones e o Reino da Caveira de Cristal', N'Indiana Jones and the Kingdom of the Crystal Skull', 2008, N'During the Cold War, Soviet agents watch Professor Henry Jones when a young man brings him a coded message from an aged, demented colleague, Henry Oxley. Led by the brilliant Irina Spalko, the Soviets tail Jones and the young man, Mutt, to Peru. With Oxley''s code, they find a legendary skull made of a single piece of quartz. If Jones can deliver the skull to its rightful place, all may be well; but if Irina takes it to its origin, she''ll gain powers that could endanger the West. Aging professor and young buck join forces with a woman from Jones''s past to face the dangers of the jungle, Russia, and the supernatural.', N'http://cf2.imgobject.com/t/p/w185/o8EdBfC7tJOPfzMzPNb5Q9fp9lD.jpg', 31, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (37, 80472, N'Bronco Billy', N'Bronco Billy', 1980, N'The film revolves around "Bronco Billy''s Wild West Show", a run-down traveling circus, the star of which is Bronco Billy McCoy (Clint Eastwood), the "fastest gun in the West." For the show''s finale, a blindfolded Bronco Billy shoots balloons around a female assistant on a revolving wooden disk, and for the last balloon, he throws a knife. However, the assistant''s leg is nicked, so she quits. The s', N'http://cf2.imgobject.com/t/p/w185/piha7ZViJesYdKHQW00BhDcpa0F.jpg', 15, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (38, 68646, N'O Poderoso Chefão', N'The Godfather', 1972, N'The story spans the years from 1945 to 1955 and chronicles the fictional Italian American Corleone crime family. When organized crime family patriarch Vito Corleone barely survives an attempt on his life, his youngest son, Michael, steps in to take care of the would-be killers, launching a campaign of bloody revenge.', N'http://cf2.imgobject.com/t/p/w185/d4KNaTrltq6bpkFS01pYtyXa09m.jpg', 32, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (39, 71562, N'O Poderoso Chefão: Parte II', N'The Godfather: Part II', 1974, N'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba', N'http://cf2.imgobject.com/t/p/w185/tHbMIIF51rguMNSastqoQwR0sBs.jpg', 32, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (40, 99674, N'O Poderoso Chefão: Parte III', N'The Godfather: Part III', 1990, N'In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don Michael Corleone seeks to vow for his sins while taking a young protege under his wing.The last film from the Godfather trilogy ends the story of the mafia boss Michael Corleone sixteen years after the first two Godfathers. Critics and the public alike say it did not live up to the level or success as the firsts did although it was nominated for seven Oscars.', N'http://cf2.imgobject.com/t/p/w185/uzaP0L7BEprcJHCuwbaHiYT0UYX.jpg', 32, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (41, 258463, N'A Identidade Bourne', N'The Bourne Identity', 2002, N'Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. Bourne realizes, though, that he has the combat and mental skills of a world-class spy, but who does he work for?', N'http://cf2.imgobject.com/t/p/w185/3AVAYaMf5R9bY3qiRXOPBSxGoue.jpg', 33, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (42, 372183, N'A Supremacia Bourne', N'The Bourne Supremacy', 2004, N'When a CIA operation to purchase classified Russian documents is blown by a rival agent, who then shows up in the sleepy seaside village where Bourne and Marie have been living. The pair run for their lives and Bourne, who promised retaliation should anyone from his former life attempt contact, is forced to once again take up his life as a trained assassin to survive.', N'http://cf2.imgobject.com/t/p/w185/6a74OaZArLNNDHK9SdiLBUu2JYj.jpg', 34, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (43, 440963, N'O Ultimato Bourne', N'The Bourne Ultimatum', 2007, N'Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Company''s best efforts to eradicate him.', N'http://cf2.imgobject.com/t/p/w185/i4KiRtl3MpdncWj39XKREPhuSJO.jpg', 34, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (44, 320691, N'Anjos da Noite', N'Underworld', 2003, N'Vampires and werewolves have waged a nocturnal war against each other for centuries. But all bets are off when a female vampire warrior named Selene, who''s famous for her strength and werewolf-hunting prowess, becomes smitten with a peace-loving male werewolf, Michael, who wants to end the war.', N'http://cf2.imgobject.com/t/p/w185/rdkxl5iXdpVU188cL1LLG3sy6z4.jpg', 35, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (45, 970452, N'Solomon Kane', N'Solomon Kane', 2009, N'Once a mercenary of Queen Elizabeth I fighting Spainards in Africa, He met the Devil''s Reaper and discovered he was bound for hell! Barely escaping he soon renounced violence to atone for his past sins, seeking out redemption in a life of peace. That is until the followers of priest turned sorcerer Malachi kidnap a Purtian girl Meredith Crowthorn and brutally slaughter her family before his very own eyes (including butchering her beloved younger brother Edward who Solomon had befriended)! Forcing Solomon to take up arms and return to his violent ways once more to rescue her!', N'http://cf2.imgobject.com/t/p/w185/cFNI02UnBGdXCromKAJ2H4p5CF1.jpg', 36, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (46, 78748, N'Alien', N'Alien', 1979, N'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.', N'http://cf2.imgobject.com/t/p/w185/uU9R1byS3USozpzWJ5oz7YAkXyk.jpg', 37, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (47, 1424381, N'Predadores', N'Predators', 2010, N'A mercenary named Royce (Brody) reluctantly leads a motley crew of warriors who soon come to realize they''ve been captured and deposited on an alien planet by an unknown nemesis. With the exception of a peculiar physician, they are all cold-blooded killers, convicts, death squad members...hunters who have now become the hunted.', N'http://cf2.imgobject.com/t/p/w185/xtx2kOAySd2jUVU4eylCgkkIi5v.jpg', 38, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (48, 1220634, N'Resident Evil: Recomeço', N'Resident Evil: Afterlife', 2010, N'In a world ravaged by a virus infection, turning its victims into the Undead, Alice (Jovovich), continues on her journey to find survivors and lead them to safety. Her deadly battle with the Umbrella Corporation reaches new heights, but Alice gets some unexpected help from an old friend. A new lead that promises a safe haven from the Undead takes them to Los Angeles, but when they arrive the city is overrun by thousands of Undead - and Alice and her comrades are about to step into a deadly trap.', N'http://cf2.imgobject.com/t/p/w185/mCGO9eDT0GrFBjZDLRr4FBQOgDx.jpg', 21, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (49, 816462, N'Conan O Bárbaro', N'Conan The Barbarian', 2011, N'A quest that begins as a personal vendetta for the fierce Cimmerian warrior soon turns into an epic battle against hulking rivals, horrific monsters, and impossible odds, as Conan (Jason Momoa) realizes he is the only hope of saving the great nations of Hyboria from an encroaching reign of supernatural evil.', N'http://cf2.imgobject.com/t/p/w185/baD8Ne93CAtjTlrZgUz7GOGnMer.jpg', 39, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (50, 1253864, N'Imortais', N'Immortals', 2011, N'A purported bastard who retains an allegiance to his mother despite the fact that he longs to join the quest of a king who is battling demons in ancient Greece later embarks on a grail of discovery that has him finding he is the king''s son and also fated to become his country''s greatest hero as he leads the successful war against long-imprisoned Titans who are hoping to use the demons to restore their power.', N'http://cf2.imgobject.com/t/p/w185/efyXTVK7oqQdQlI2YGWOkJVpbqZ.jpg', 40, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (51, 822847, N'Padre', N'Priest', 2011, N'From Wikipedia, the free encyclopedia.Priest is a 2011 American supernatural action film starring Paul Bettany as the title character. The film, directed by Scott Stewart, is based on the Korean comic of the same name. In an alternate world, humanity and vampires have warred for centuries. After the last Vampire War, the veteran Warrior Priest (Bettany) lives in obscurity with other humans inside one of the Church''s walled cities. When the Priest''s niece (Lily Collins) is kidnapped by vampires, the Priest breaks his vows to hunt them down. He is accompanied by the niece''s boyfriend (Cam Gigandet), who is a wasteland sheriff, and a former Warrior Priestess (Maggie Q).Description above from the Wikipedia article Priest (2011 film), licensed under CC-BY-SA, full list of contributors on Wikipedia.', N'http://cf2.imgobject.com/t/p/w185/pE28BDqICBPe3FgphsYSxtH6FcZ.jpg', 41, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (52, 370263, N'Alien vs. Predador', N'AVP: Alien vs. Predator', 2004, N'When scientists discover something in the Arctic that appears to be a buried Pyramid, they send a research team out to investigate. Little do they know that they are about to step into a hunting ground where Aliens are grown as sport for the Predator race. The films sees two of the largest comic and movie franchises collide in an all out war.', N'http://cf2.imgobject.com/t/p/w185/zDkq4lFZMAHC8XwNACNosAsS0kh.jpg', 21, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (53, 990407, N'Besouro Verde', N'The Green Hornet', 2011, N'Britt Reid is the party-animal son of LAs most distinguished media magnate and perfectly happy to maintain a directionless existence - until his father mysteriously dies, leaving Britt his vast media empire. Striking a friendship with Kato, one of his fathers more inventive employees, Reid sees his chance to do something meaningful for the first time in his life: fight crime as the masked vigilante The Green Hornet with Kato at his side. Their plan? Break the law in order to protect it from the scum of LA, including crime lord Benjamin Chudnofsky.', N'http://cf2.imgobject.com/t/p/w185/xYEBtscvOA7JWh2MSvcnkAaeAyc.jpg', 42, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (54, 758730, N'Aliens vs Predador 2', N'AVPR: Aliens vs Predator - Requiem', 2007, N'Prepare for more mayhem as warring aliens and predators return for Round 2 of their no-holds-barred slugfest. This time, the intergalactic creatures do battle in a small American town, throwing local residents into harm''s way. To save the planet, the humans must oust both types of unwelcome guests. This sci-fi sequel features tons of spectacular action sequences full of nifty new gadgets and gooey monster gore.', N'http://cf2.imgobject.com/t/p/w185/u4S3eIGmG3LWEdPucNlEcFXv3Ng.jpg', 43, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (55, 1133985, N'Lanterna Verde', N'Green Lantern', 2011, N'For centuries, a small but powerful force of warriors called the Green Lantern Corps has sworn to keep intergalactic order. Each Green Lantern wears a ring that grants him superpowers. But when a new enemy called Parallax threatens to destroy the balance of power in the Universe, their fate and the fate of Earth lie in the hands of the first human ever recruited.', N'http://cf2.imgobject.com/t/p/w185/sVw0RlPnWca8w7Zb8CaxOdeHESb.jpg', 44, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (56, 1194173, N'O Legado Bourne', N'The Bourne Legacy', 2012, N'A story centered on a new CIA operative in the universe based on Robert Ludlum''s novels.', N'http://cf2.imgobject.com/t/p/w185/sCjBwfzwJP0qGTYxQdUKgZe28AV.jpg', 45, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (57, 1343727, N'Dredd', N'Dredd', 2012, N'In a violent, futuristic city, the police have the authority to act as judge, jury and executioner.', N'http://cf2.imgobject.com/t/p/w185/3l7iyehiKXTPtiW6yo5y3hzgIHi.jpg', 46, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (58, 409847, N'Cowboys & Aliens', N'Cowboys & Aliens', 2011, N'The Old West.. where a lone cowboy leads an uprising against a terror from beyond our world. 1873. Arizona Territory. A stranger with no memory of his past stumbles into the hard desert town of Absolution. The only hint to his history is a mysterious shackle that encircles one wrist. What he discovers is that the people of Absolution don''t welcome strangers, and nobody makes a move on its streets unless ordered to do so by the iron-fisted Colonel Dolarhyde (Ford). It''s a town that lives in fear. But Absolution is about to experience fear it can scarcely comprehend as the desolate city is attacked by marauders from the sky. Screaming down with breathtaking velocity and blinding lights to abduct the helpless one by one, these monsters challenge everything the residents have ever known. Now, the stranger they rejected is their only hope for salvation. As this gunslinger slowly starts to remember who he is and where he''s been...', N'http://cf2.imgobject.com/t/p/w185/nS0jhSjhxCOvqzs68WsPdG8y5h6.jpg', 1, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (59, 381849, N'Os Indomáveis', N'3:10 to Yuma', 2007, N'In Arizona in the late 1800''s, infamous outlaw Ben Wade and his vicious gang of thieves and murderers have plagued the Southern Railroad. When Wade is captured, Civil War veteran Dan Evans, struggling to survive on his drought-plagued ranch, volunteers to deliver him alive to the "3:10 to Yuma", a train that will take the killer to trial.', N'http://cf2.imgobject.com/t/p/w185/rzWB6fIveNySqZGIpZs2Wp3lcvR.jpg', 47, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (60, 1496025, N'Anjos da Noite: O Despertar', N'Underworld: Awakening', 2012, N'After being held in a coma-like state for fifteen years, vampire Selene (Kate Beckinsale) learns that she has a fourteen-year-old vampire/Lycan hybrid daughter, Nissa, and when she finds her, they must stop BioCom from creating super Lycans that will kill them all.', N'http://cf2.imgobject.com/t/p/w185/7dcYksuGj5Co5ani4Log01PJKrk.jpg', 48, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (61, 186566, N'Cowboys do Espaço', N'Space Cowboys', 2000, N'Frank Corvin, "Hawk" Hawkins, Jerry O''Neill and Tank Sullivan were hotdog members of Project DAEDALUS, the Air Force''s test program for space travel. Their hopes were dashed in 1958 with the formation of NASA and the use of trained chimps. They blackmail their way into orbit when Russia''s mysterious Ikon communications satellite''s orbit begins to degrade and threatens to crash into Earth.', N'http://cf2.imgobject.com/t/p/w185/4m8aDdWIMmBJXT8IHTLssC2svkS.jpg', 15, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (62, 145487, N'Homem Aranha', N'Spider-Man', 2002, N'After being chomped by a genetically altered spider, shy high schooler Peter Parker is endowed with amazing superpowers. And while he first uses them to win wrestling matches, he''ll eventually need them to battle a villain known as the Green Goblin. Peter''s abilities allow him to win the girl of his dreams, but family tragedy and a suspicious best friend leave him emotionally drained.', N'http://cf2.imgobject.com/t/p/w185/uZLl4hhrAXtydamH6H04pj9SmbM.jpg', 49, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (63, 133093, N'Matrix', N'The Matrix', 1999, N'Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a malevolent hacker known as Neo. Neo has always questioned his reality but the truth is far beyond his imagination. Neo finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker branded a terrorist by the government. Morpheus awakens Neo to the real world, a ravaged wasteland where most of humanity have been captured by a race of machines which live off of their body heat and imprison their minds within an artificial reality known as the Matrix. As a rebel against the machines, Neo must return to the Matrix and confront the agents, super powerful computer programs devoted to snuffing out Neo and the entire human rebellion.', N'http://cf2.imgobject.com/t/p/w185/hQbK3uQugauukGy0xJJI8XlPKqP.jpg', 50, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (64, 234215, N'Matrix Reloaded', N'The Matrix Reloaded', 2003, N'Neo and the rebel leaders estimate that they have 72 hours until 250,000 probes discover Zion and destroy it and its inhabitants. During this, Neo must decide how he can save Trinity from a dark fate in his dreams.', N'http://cf2.imgobject.com/t/p/w185/ezIurBz2fdUc68d98Fp9dRf5ihv.jpg', 51, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (65, 242653, N'Matrix Revolutions', N'The Matrix Revolutions', 2003, N'The human city of Zion defends itself against the massive invasion of the machines as Neo fights to end the war at another front while also opposing the rogue Agent Smith.', N'http://cf2.imgobject.com/t/p/w185/sKogjhfs5q3azmpW7DFKKAeLEG8.jpg', 51, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (66, 335345, N'A Paixão de Cristo', N'The Passion of the Christ', 2004, N'"The Passion of the Christ" is a film about the last 12 hours in the life of Jesus. Director Mel Gibson received much criticism from critics and audiences for his explicit depiction of and focus on violence and on christs suffering, especially on the part of the jewish community. The films languages are Arabic, Latin and Hebrew and its actors are laymen which was controversially received as well.', N'http://cf2.imgobject.com/t/p/w185/6KyvP5bDmwTYdLLnhEn10NFPDIZ.jpg', 52, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (67, 1318514, N'A Origem do Planeta dos Macacos', N'Rise of the Planet of the Apes', 2011, N'Scientist Will Rodman is determined to find a cure for Alzheimer''s, the disease which has slowly consumed his father Charles. Will feels certain he is close to a breakthrough and tests his latest serum on chimpanzees, noticing dramatic increases in intelligence and brain activity in the primate subjects. A baby called Caesar, born to one of the test chimps, is scheduled to be destroyed so Will smuggles the animal home where he raises the infant as his own, little knowing that the onset of a war for supremacy has begun...', N'http://cf2.imgobject.com/t/p/w185/ddWSWgAjAhksNhMeeBTSqY6otIA.jpg', 53, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (68, 237534, N'O Pacto dos Lobos', N'Le Pacte des Loups', 2001, N'In 18th century France, the Chevalier de Fronsac and his native American friend Mani are sent by the King to the Gevaudan province to investigate the killings of hundreds by a mysterious beast.', N'http://cf2.imgobject.com/t/p/w185/mQeW7ahPaFnLme5SdNHURxrMh41.jpg', 54, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (69, 364569, N'Oldboy', N'Oldeuboi', 2003, N'Oldboy is the revenge drama from Director Park Chan-wook. Based on a Manga comic it depicts the suffering path of a man who must deal with the never ending torment of having unknowingly made someone his enemy.', N'http://cf2.imgobject.com/t/p/w185/jB7ol6ry8dlqMp6kKlKHLfPke4e.jpg', 55, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (70, 90605, N'Aliens', N'Aliens', 1986, N'When Ripley''s lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story... all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.', N'http://cf2.imgobject.com/t/p/w185/ahv86tYpSn67TnA3Z4Y5tS293VR.jpg', 28, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (71, 406375, N'Zathura: Uma Aventura Espacial', N'Zathura: A Space Adventure', 2005, N'Two squabbling brothers are propelled into deepest, darkest space while playing a mysterious game they discovered in the basement of their old house. On their fantastic journey, they are joined by a stranded astronaut and must survive several outer space challenges. Unless they finish the game and reach the planet Zathura, they could be trapped in outer space forever.', N'http://cf2.imgobject.com/t/p/w185/amqgIuISRBt8tsZM6cTT6gO9WLR.jpg', 1, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (72, 405159, N'menina de Ouro', N'Million Dollar Baby', 2004, N'Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn''t prepared for boxer Maggie Fitzgerald to enter his life. But Maggie''s determined to go pro and to convince Dunn and his cohort to help her.', N'http://cf2.imgobject.com/t/p/w185/4OYfqj1ZggYpH6oLxSKSFTsjWOp.jpg', 15, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (73, 338526, N'Van Helsing', N'Van Helsing', 2004, N'Vampire hunter extraordinaire Dr. Van Helsing travels to a mysterious region of Eastern Europe on a quest to vanquish the big three -- Count Dracula, the Wolf Man and Frankenstein''s Monster. On hand is Van Helsing''s intrepid assistant, Anna, the heir to a family committed to hunting down and destroying the Count.', N'http://cf2.imgobject.com/t/p/w185/bNuAuvn2CorF8FoToxe3CRM4mZ7.jpg', 56, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (74, 1601913, N'A Perseguição', N'The Grey', 2012, N'In Alaska, an oil drilling team struggle to survive after a plane crash strands them in the wild. Hunting the humans are a pack of wolves who see them as intruders.', N'http://cf2.imgobject.com/t/p/w185/ebGZBboPnwJaTy7ytC38Rnkxk44.jpg', 57, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (75, 116367, N'Um Drink no Inferno', N'From Dusk Till Dawn', 1996, N'Seth Gecko and his younger brother Richard are on the run after a bloody bank robbery in Texas. They escape across the border into Mexico and will be home-free the next morning, when they pay off the local kingpin. They just have to survive ''from dusk till dawn'' at the rendezvous point, which turns out to be a Hell of a strip joint.', N'http://cf2.imgobject.com/t/p/w185/oXPFIgpmadb77T7gqO8I6dHwd4f.jpg', 58, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (76, 462499, N'Rambo', N'Rambo', 2008, N'When governments fail to act on behalf of captive missionaries, ex-Green Beret John James Rambo sets aside his peaceful existence along the Salween River in a war-torn region of Thailand to take action. Although he''s still haunted by violent memories of his time as a U.S. soldier during the Vietnam War, Rambo can hardly turn his back on the aid workers who so desperately need his help.', N'http://cf2.imgobject.com/t/p/w185/cJDEP158dKNdkWGcpokFzk7cwvj.jpg', 59, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (77, 83907, N'The Evil Dead - A Morte do Demônio', N'The Evil Dead', 1981, N'Ever-present, ever-listening, the Evil Dead lies in wait for the one ancient incantation that will give them license to possess the living. Watch in horror as five vacationing college students are forced into battle with the supernatural forces that occupy the forests and dark bowers of man''s domain. The innocent must suffer. The guilty must be punished. One-by-one, the students are possessed by these demons whose thirst for revenge is insatiable. As the night wanes, only one man remains... Ash. He must now defend himself while trying to uncover the horrible secret of The Evil Dead.', N'http://cf2.imgobject.com/t/p/w185/epmCbk2oUms80M6ISP45IBdC09q.jpg', 49, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (78, 92991, N'Uma Noite Alucinante', N'Evil Dead II', 1987, N'Ash Williams and his girlfriend Linda find a log cabin in the woods with a voice recording from an archeologist who had recorded himself reciting ancient chants from The Book of the Dead. As they play the recording an evil power is unleashed taking over Lindas body.', N'http://cf2.imgobject.com/t/p/w185/n49mpgUsPgBfRg2qIEj31HX0chu.jpg', 49, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (79, 106308, N'Uma Noite Alucinante 3', N'Army of Darkness', 1992, N'After being transported through a time portal to the Middle Ages, Ash (Campbell) finds himself trying to get back to the future by going on a quest to find the Book of the Dead. In true Ash fashion, he accidentally unleashes an army of...you guessed it, evil dead. This final film from the cult classic Evil Dead trilogy is more comedic and less violent than its predecessors.', N'http://cf2.imgobject.com/t/p/w185/2eZKDIwLNnySbwqQtAaUz0kYDIL.jpg', 49, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (80, 432021, N'Resident Evil: Extinção', N'Resident Evil: Extinction', 2007, N'Years after the Raccoon City disaster, Alice is on her own; aware that she has become a liability and could endanger those around her, she is struggling to survive and bring down the Umbrella Corporation led by the sinister Albert Wesker and head researcher Dr. Isaacs. Meanwhile, traveling through the Nevada Desert and the ruins of Las Vegas, Carlos Olivera, L.J., and new survivors K-Mart, Claire Redfield, and Nurse Betty must fight to survive extinction against hordes of zombies, killer crows and the most terrifying creatures created as a result of the deadly T-Virus that has killed millions.', N'http://cf2.imgobject.com/t/p/w185/3sAiP55j0souKMCYlo5wmwWAgaG.jpg', 60, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (81, 83658, N'Blade Runner', N'Blade Runner', 1982, N'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to snuff a quartet of replicants - androids consigned to slave labor on remote planets. They''ve escaped to Earth seeking their creator and a way to extend their short life spans.', N'http://cf2.imgobject.com/t/p/w185/keDKC1r2SyA6uDkEzzVyH8xUzW8.jpg', 37, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (82, 91203, N'Highlander', N'Highlander', 1986, N'He fought his first battle on the Scottish Highlands in 1536. He will fight his greatest battle on the streets of New York City in 1986. His name is Connor MacLeod. He is immortal.', N'http://cf2.imgobject.com/t/p/w185/llR4qqL5dptoV7yP9TstZgprLEV.jpg', 60, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (83, 102034, N'Highlander II: The Quickening', N'Highlander II: The Quickening', 1991, N'In the year 2025, the ozone layer is believed to have been destroyed. It is up to MacLeod and Rameriz to set things right. Opposition comes from both the planet Ziest (MacLeod and Ramirez''s homeworld) and a corporation profiting from the supposed lack of ozone. Also, flashbacks show the story behind MacLeod and Ramirez''s exile from Ziest.', N'http://cf2.imgobject.com/t/p/w185/7W43CXQh6jF9NhnBnlA4BoaFp8W.jpg', 60, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (84, 110027, N'Highlander 3 - O Feiticeiro', N'Highlander III: The Final Dimension', 1994, N'Starts off in the 15th century, with Connor McLeod (Christopher Lambert) training with another immortal swordsman, the Japanese sorcerer Nakano (Mako). When an evil immortal named Kane (Mario Van Peebles) kills the old wizard, the resulting battle leaves him buried in an underground cave. When Kane resurfaces in the 20th century to create havoc, it''s up to McLeod to stop him.', N'http://cf2.imgobject.com/t/p/w185/tW1fR4S2wT4LTCAmEeXU0jlwcbS.jpg', 61, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (85, 103644, N'Alien 3', N'Alien 3', 1992, N'After escaping with Newt and Hicks from the alien planet, Ripley crash lands on Fiorina 161, a prison planet and host to a correctional facility. Unfortunately, although Newt and Hicks do not survive the crash, a more unwelcome visitor does. The prison does not allow weapons of any kind, and with aid being a long time away, the prisoners must simply survive in any way they can.', N'http://cf2.imgobject.com/t/p/w185/vz1vBw17F0x42bhziHdYRJC9uCv.jpg', 62, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (86, 118583, N'Alien: Ressurreição', N'Alien: Resurrection', 1997, N'Two hundred years after Lt. Ripley died, a group of scientists clone her, hoping to breed the ultimate weapon. But the new Ripley is full of surprises INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (87, 401855, N'Anjos da Noite: Evolução', N'Underworld: Evolution', 2006, N'As the war between the vampires and the Lycans rages on, Selene, a former member of the Death Dealers (an elite vampire special forces unit that hunts werewolves), and Michael, the werewolf hybrid, work together in an effort to unlock the secrets of their respective bloodlines.', N'http://cf2.imgobject.com/t/p/w185/g5IYBZnLG8ThwVoB7PF7DeNnvvY.jpg', 35, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (88, 82971, N'Os Caçadores da Arca Perdida', N'Raiders of the Lost Ark', 1981, N'When Dr. Indiana Jones -- the tweed-suited professor who just happens to be a celebrated archaeologist -- is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.', N'http://cf2.imgobject.com/t/p/w185/qB4BK9ddEbuka8G38AlnXBDDwt3.jpg', 31, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (89, 133152, N'Planeta dos Macacos', N'Planet of the Apes', 2001, N'After a spectacular crash-landing on an uncharted planet, brash astronaut Leo Davidson (Mark Wahlberg) finds himself trapped in a savage world where talking apes dominate the human race. Desperate to find a way home, Leo must evade the invincible gorilla army led by Ruthless General Thade (Tim Roth) and his most trusted warrior, Attar (Michael Clarke Duncan).', N'http://cf2.imgobject.com/t/p/w185/uHp6PTo7SCrqdH5wCSrCCf8EQFX.jpg', 64, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (90, 311429, N'A Liga Extraordinária', N'The League of Extraordinary Gentlemen', 2003, N'In an alternate turn of the 20th century, an attack on the Bank of England by men who appear to be German soldiers followed by an attack on a German Zeppelin factory by the same men this time dressed as British soldiers, leads Europe to the brink of war. An emissary of the British government, arrives in Africa, hoping to recruit the legendary hunter Allan Quatermain to investigate the situation.', N'http://cf2.imgobject.com/t/p/w185/AliSeCLFB6ZAkQIxosr8RAkFf6R.jpg', 65, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (91, 87469, N'Indiana Jones e o Templo da Perdição', N'Indiana Jones and the Temple of Doom', 1984, N'After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees, and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.', N'http://cf2.imgobject.com/t/p/w185/c8wjjTnqxnG835iSEeWUJJifSVp.jpg', 31, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (92, 113497, N'Jumanji', N'Jumanji', 1995, N'When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult who''s been trapped inside the game for 26 years -- into their living room. Alan''s only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.', N'http://cf2.imgobject.com/t/p/w185/3ULCeNyaz5rAPCB2XPWntf1yGGb.jpg', 24, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (93, 97576, N'Indiana Jones e a Última Cruzada', N'Indiana Jones and the Last Crusade', 1989, N'Three years after he recovered The Ark of the Covenant. Jones recovered an artifact that he found as a kid, the Cross of Francisco De Coronado from treasure hunters. Now, Jones discovers the history of another biblical artifact called "The Holy Grail". He was also informed that his father, Henry Jones is missing. Jones has to find his father who is looking for the Grail. However, Jones will become involved in the search of the Holy Grail along with his father, as well as fighting the Nazis to reach it.', N'http://cf2.imgobject.com/t/p/w185/cdYOq7aN465TXUTgSqGL5ZdWKQW.jpg', 31, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (94, 120685, N'Godzilla', N'Godzilla', 1998, N'When a freighter is viciously attacked in the Pacific Ocean, a team of experts -- including biologist Niko Tatopoulos and scientists Elsie Chapman and Mendel Craven -- concludes that an oversized reptile is the culprit. Before long, the giant lizard is loose in Manhattan, destroying everything within its reach. The team chases the monster to Madison Square Garden, where a brutal battle ensues.', N'http://cf2.imgobject.com/t/p/w185/wMP1s5pWSHfdeocux4aB9WddcaG.jpg', 66, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (95, 368909, N'Ong Bak', N'Ong Bak', 2003, N'When the head of a statue sacred to a village is stolen, a young martial artist goes to the big city and finds himself taking on the underworld to retrieve it.', N'http://cf2.imgobject.com/t/p/w185/10WwNPqlA1GuIu6IWfuz7wSpkmo.jpg', 67, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (96, 82198, N'Conan o Bárbaro', N'Conan the Barbarian', 1982, N'A village is attacked by the evil ruler of the Snake Cult, Thulsa Doom and his evil warriors, when Thulsa Doom and his warriors kills his parents, a young boy named Conan is enslaved. Years later, Conan grows up and becomes a mighty warrior and is trained as a fighter. After years as a slave and as a gladiator, Conan is set free. Joined by an archer named Subotai, a beautiful thief whom he falls in love with named Valeria and a Chinese wizard, Conan sets out to rescue King Osric''s daughter Yasmina, and get his revenge on Thulsa Doom.', N'http://cf2.imgobject.com/t/p/w185/9siMCK6u0TtgDVtCJQGKRQAnAqA.jpg', 68, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (97, 287978, N'Demolidor', N'Daredevil', 2003, N'He dwells in a world of external night, but the blackness is filled with sounds and scents, tastes and textures that most cannot perceive. Although attorney Matt Murdock is blind, his other four senses function with superhuman sharpness. By day, Murdock represents the downtrodden. At night he is Daredevil, a masked vigilante stalking the dark streets of the city, a relentless avenger of justice.', N'http://cf2.imgobject.com/t/p/w185/slyj0dRwcF1tBvPQk0zvJDDxFDg.jpg', 69, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (98, 113492, N'O Juíz', N'Judge Dredd', 1995, N'In a dystopian future, Dredd, the most famous judge (a cop with instant field judiciary powers) is convicted for a crime he did not commit while his murderous counterpart escapes.', N'http://cf2.imgobject.com/t/p/w185/yDcVnC9Homd2Trt1rz7AzB7lx73.jpg', 70, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (99, 87078, N'Conan o Destruidor', N'Conan the Destroyer', 1984, N'Another evil threatens to conquer the world, as Conan journeys on a search to find a magic crystal before the sorcerer Toth Amon can use it. He is also required to rescue the Princess Jehnna for the treacherous Queen Taramis who plans to betray Conan and rule the world.', N'http://cf2.imgobject.com/t/p/w185/7lY9JyUL7JWny1WRyNK7ITLsZAV.jpg', 71, NULL)
INSERT INTO FILME (ID_FILME, ID_IMDB_FILME, NOME_FILME, NOME_ORIGINAL_FILME, ANO_FILME, SINOPSE_FILME, FOTO_FILME, ID_DIRETOR, DATA_EXCLUSAO_FILME) VALUES (100, 89893, N'Guerreiros de Fogo', N'Red Sonja', 1985, N'The tyrant Gedren seeks the total power in a world of barbarism. She raids the city Hablac and kills the keeper of a talisman that gives her great power. Red Sonja, sister of the keeper, sets out with her magic sword to overthrow Gedren.', N'http://cf2.imgobject.com/t/p/w185/wpMyvDEgiKLgu90twkzs83c5Nml.jpg', 71, NULL)
