USE FILMOTECA

CREATE TABLE ATOR
(
       ID_ATOR INT NOT NULL IDENTITY PRIMARY KEY,
       NOME_ATOR VARCHAR(50) NOT NULL,
       DATA_EXCLUSAO_ATOR DATETIME NULL
)
 
CREATE TABLE DIRETOR
(
       ID_DIRETOR INT NOT NULL IDENTITY PRIMARY KEY,
       NOME_DIRETOR VARCHAR(50) NOT NULL UNIQUE,
       DATA_EXCLUSAO_DIRETOR DATETIME NULL
)
 
CREATE TABLE GENERO
(
       ID_GENERO INT NOT NULL IDENTITY PRIMARY KEY,
       NOME_GENERO VARCHAR(50) NOT NULL UNIQUE,
       DATA_EXCLUSAO_GENERO DATETIME NULL
)
 
CREATE TABLE FILME
(
       ID_FILME INT NOT NULL IDENTITY PRIMARY KEY,
       ID_IMDB_FILME INT NOT NULL,
       NOME_FILME VARCHAR(50) NOT NULL,
       NOME_ORIGINAL_FILME VARCHAR(50) NULL,
       ANO_FILME INT NULL CHECK(ANO_FILME BETWEEN 1940 AND YEAR(GETDATE())),
       SINOPSE_FILME VARCHAR(MAX),
       FOTO_FILME VARCHAR(200), 
       ID_DIRETOR INT NOT NULL FOREIGN KEY REFERENCES DIRETOR,
       DATA_EXCLUSAO_FILME DATETIME NULL
)
 
CREATE TABLE FILME_ATOR
(
       ID_FILME INT NOT NULL FOREIGN KEY REFERENCES FILME,
       ID_ATOR INT NOT NULL FOREIGN KEY REFERENCES ATOR,
       NOME_PERSONAGEM VARCHAR(50),
       CONSTRAINT PK_FILME_ATOR PRIMARY KEY(ID_FILME, ID_ATOR, NOME_PERSONAGEM)
)
 
CREATE TABLE FILME_GENERO
(
       ID_FILME INT NOT NULL FOREIGN KEY REFERENCES FILME,
       ID_GENERO INT NOT NULL FOREIGN KEY REFERENCES GENERO,
       CONSTRAINT PK_FILME_GENERO PRIMARY KEY(ID_FILME, ID_GENERO)
)

